import { useEffect, useState } from "react"
import { Link } from "react-router-dom"

export default function User(){

    const [meals,set]=useState([])

    const[num,inc]=useState(0);





    console.log(meals)

    useEffect(()=>{
        fetch('http://localhost:8000/getmeals',{
            headers:{
                'auth-token':localStorage.getItem('auth-token')
            }
        }).then(data=>data.json()).then(data=>set(data))
    },[])

    return(
<div style={{width:'100%',height:'100vh',padding:'4rem 4rem'}}>
        {localStorage.getItem('auth-token') && meals.length && <><table className="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Time</th>
      <th scope="col">Meal</th>
      <th scope="col">Date</th>

    </tr>
  </thead>
  <tbody>
    {meals.map((elem,index)=><tr key={index}>
      <th scope="row">{index+1}</th>
      <td className="table-primary">{elem.allmeals.title}</td>
      <td className="table-info">{elem.allmeals.content}</td>
      <td className="table-info">{elem.allmeals.mealdatex   }</td>
    </tr>)}


  </tbody>
</table></>
        }
        {!localStorage.getItem('auth-token') &&

        <div >You need to login first <Link className="btn btn-primary" to={'/login'}>Login</Link></div>}

        </div>

    )
}
